const GiftCardsPage = () => (
    <div className="generic-page">
        <h1>Gift Cards</h1>
        <p>Give the perfect gift with a Shopify gift card. Choose from a variety of designs and amounts.</p>
        <h2>Buy a Gift Card</h2>
        <p>Purchase a gift card and send it to a friend or family member via email.</p>
        <h2>Redeem a Gift Card</h2>
        <p>Have a gift card? Redeem it here to add the balance to your account.</p>
    </div>
);

